script: |
  super -f text -I q4753.spq | sort > q4753.out

inputs:
  - name: q4753.spq
    data: |
      SELECT + + ( + col2 ) AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - 39 * + col1 IN ( + 64 / - 60 * - col2 * - 98, + col0 + + col2 + + col0 * 97 );
  - name: tab0

outputs:
  - name: q4753.out
    data: |
      10
      47
      99
